import React from "react";
import "../Css/Navbar.css";
import logo from "../Images/logo.png";
import person from "../Images/person.svg";



import { BrowserRouter as Router, Route, NavLink } from "react-router-dom";

const Navbar = () => {
    return (
        <Router>
            <header>
                <div className="container container-flex">
                    <div className="logo">
                        <img src={logo} alt="logo" className="logo" />
                    </div>
                    <nav>
                        <div className="list">
                            <NavLink to="/" className="listItem" activeClassName="activeItem">Home</NavLink>
                            <NavLink to="/author" className="listItem" activeClassName="activeItem">Your Songs</NavLink>
                            <NavLink to="/playlist" className="listItem" activeClassName="activeItem">Playlist</NavLink>
                            <NavLink to="/subs" className="listItem" activeClassName="activeItem">Subscription</NavLink>
                        </div>
                    </nav>

                    <div className="icon">
                        <img src={person} alt="person" className="person" />
                    </div>
                </div>
            </header>
        </Router>
    );
}

export default Navbar;
